import { createGlobalStyle } from 'styled-components';

const Ser_style = createGlobalStyle`
//  design
.img-skils{
    // width:100%;
    height:150px;
    margin:20px 0;
}
.d-flex{
    display:flex;
    justify-content:center;
}

// web devlopment
.step-1{
    background:#607d8b;
    padding:20px;
    margin-bottom:30px;
}
.step-title{
    color:#ccc;
}
.step-1-content{
    background:#ccc;
    margin:10px auto;
    padding:10px 0;
    line-height:40px;
}
.foot-heading{
    padding-left:20px;
    padding-top:30px;
    font-size:26px;
}
.foot-content{
    padding-top:20px;
    padding-left:15px;
}
`;
export default Ser_style;
